export const addNewPost = async (postObject) => {
    try {
        console.log("object", postObject);
        const response = await axios.post(`${rootURL}/posts`,
            `title=${postObject.title}&content=${postObject.content}&category=${postObject.category}&housingType=${postObject.housinType}`);
        console.log("add new post", response.data);
        return response.data;
    } catch (err) {
        console.error("error", err.response.data);
    }
}

module.exports = {
    addNewPost
}
